		var mousestatus = false;
		var mouselastX = 0;
		var mouselastY = 0;
		var scale=1n;
		function mouse_wheel(e) {
			e = e || window.event;
			var delta = e.deltaY || e.detail || e.wheelDelta;
			var ua = navigator.userAgent;
			
			if (ua.search(/Chrome/) > 0)
				delta=-delta;
			mouse_wheel2(delta);
			e.preventDefault ? e.preventDefault() : (e.returnValue = false);
		}
		function mouse_wheel2(k)
		{
			if (k<0)
				posZ=posZ*100n/75n;
			else
				posZ=posZ*75n/100n;
			if (posZ>5n*onen)
			{
				oncl(0);
				posZ=5n*onen;
			}
			while (posZ<10n**20n)
			{
				onen*=10n;
				posX*=10n;
				posY*=10n;
				posZ*=10n;
			}
			pr_pos();
			pool_update();
			render();
		}
		function mouse_down(e)
		{
			mousestatus = true;
			mouselastX = parseFloat(getPosition(e).split(':')[0]);
			mouselastY = parseFloat(getPosition(e).split(':')[1]);
			mouse_move(e);
			pool_update();
			render();
		}
		function mouse_move(e)
		{
			var positionx = parseFloat(getPosition(e).split(':')[0]);
			var positiony = parseFloat(getPosition(e).split(':')[1]);
			if (mousestatus) {
				posX+=BigInt(positionx - mouselastX)*posZ/scale;
				posY+=BigInt(positiony - mouselastY)*posZ/scale;
				pr_pos();
			}
			mouselastX = positionx;
			mouselastY = positiony;
			render();
		}
		function mouse_up(e)
		{
			if (mousestatus == true)
				pr_pos();
			mousestatus = false;
			pool_update();
			render()
		}
		function BigIntToStr(n)
		{
			if (n<0)
				return '-'+BigIntToStr(-n);
			if (n % onen==0n)
				return ''+(n / onen);
			return ''+(n/onen)+('.'+(onen+n % onen)).replace(/[0]*$/gi,'').replace('1','');
		}
		function pr_pos()
		{
			//console.log(posX,posY,posZ);
			pos_text.innerHTML='X: <input type="text" style="vertical-align:middle;width:calc(100% - 50px);background:#0000001a;color:white;" value="'+BigIntToStr(posX)+'"><br>Y: <input style="vertical-align:middle;width:calc(100% - 50px);background:#0000001a;color:white;" type="text" value="'+BigIntToStr(posY)+'"><br>Z: <input style="vertical-align:middle;width:calc(100% - 50px);background:#0000001a;color:white;" type="text" value="'+BigIntToStr(posZ)+'">';
		}
		function rectanglesIntersect(minAx, minAy, maxAx, maxAy, minBx, minBy, maxBx, maxBy) {
			if (minAx>maxAx)
				console.log('err');
			return maxAx >= minBx && minAx <= maxBx && minAy <= maxBy && maxAy >= minBy;
		}
		function pool_update()
		{

			draw_pool=[];
			var t=1000;
			while (stack.length)
			{
				//var index = Math.floor(Math.random()*stack.length);
				//var e=stack[index];
				//stack.splice( index, 1 );
				//if (!(t--))break;
				var e=stack.shift();
				//if (!rectanglesIntersect(-posX-posZ/2n,-posY-posZ/2n,-posX+posZ/2n,-posY+posZ/2n,e[1],e[2],e[1]+e[3],e[2]+e[3]))  // не отрисовывается 
				//{
					//console.log('1');
				//	continue;
				//}
				draw_pool.push([e[1], e[2], e[3], e[3], all_tileset_info[e[0]].x, all_tileset_info[e[0]].y]);
				//if (posZ/e[3]>50n)  // слишком маленький
				//{
					//draw_pool.push([e[1], e[2], e[3], e[3], all_tileset_info[e[0]].color]);
					//console.log('2');
				//	continue;
				//}
				if (posZ/100n*40n>e[3])
					continue;
				for (var i=0;i<25;i++)
				{
					if (rectanglesIntersect(-posX-posZ/2n,-posY-posZ/2n,-posX+posZ/2n,-posY+posZ/2n,e[1]+e[3]*BigInt(i)/25n,e[2],e[1]+e[3]*BigInt(i)/25n+e[3]/25n,e[2]+e[3]))
						for (var j=0;j<25;j++)
						{
							var e2=[all_tileset_info[e[0]].recurs[j][i],e[1]+e[3]*BigInt(i)/25n,e[2]+e[3]*BigInt(j)/25n,e[3]/25n];
							//	break;
							if (rectanglesIntersect(-posX-posZ/2n,-posY-posZ/2n,-posX+posZ/2n,-posY+posZ/2n,e2[1],e2[2],e2[1]+e2[3],e2[2]+e2[3]))
									stack.push(e2);
						}
				}
				//	continue;
				/*var k=onen/100n;
				while (k>0n)
				{
					draw_pool.push([-5n*onen/10n, -5n*onen/10n, k, k, "#FFF"]);
					draw_pool.push([-5n*onen/10n, -5n*onen/10n, k/10n, k/10n, "#000"]);
					k/=100n;
				}*/
			}
			/*draw_pool.sort(function (a, b) {
				if (a[4] > b[4]) {
					return 1;
				}
				if (a[4] < b[4]) {
					return -1;
				}
				// a должно быть равным b
				return 0;
			});*/
			//draw_pool=[];
			render();
		}
		var draw_pool=[];
		function render()
		{
			//pos_text.innerHTML='123';
			if (canvas.clientHeight != canvas.height || canvas.clientWidth != canvas.width) {
				canvas.height = canvas.clientHeight;
				canvas.width = canvas.clientWidth;
			}
			scale = BigInt(Math.round(Math.max(canvas.width,canvas.height)));
			ctx.fillStyle = "#4f51bf";
			ctx.fillRect(0, 0, canvas.width, canvas.height);
			//if (i_img_loaded)
				//ctx.drawImage(i_img, 0, 0);
			if (i_img_loaded)
				for (var i=0;i<draw_pool.length;i++)
				{
					//if (ctx.fillStyle != draw_pool[i][4])
					//	ctx.fillStyle = draw_pool[i][4];
					DrawMyImg(draw_pool[i][0], draw_pool[i][1], draw_pool[i][2], draw_pool[i][3], draw_pool[i][4], draw_pool[i][5]);
				}
			//requestAnimationFrame(render);
		}
		function BigInt2Num(n) {return Number(10000n*n/onen)/10000};
		function DrawMyImg(a, b, c, d, x, y) {
			if (c/posZ>100n)
				return;
			if (d/posZ>100n)
				return;
			ctx.drawImage(canvas3,x*200,y*200,200,200, BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
			//ctx.fillRect(BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
		}
		function DrawMyRect(a, b, c, d) {
			if (c/posZ>100n)
				return;
			if (d/posZ>100n)
				return;
			ctx.fillRect(BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
		}
		var needzoom=0;
		function oncl(e)
		{
			needzoom=0;
			if (e<0)
			{
				if (document.getElementById('minzoom').value=='-') {
					needzoom=-1;
					document.getElementById('minzoom').value='0';
					document.getElementById('maxzoom').value='+';
				}else{
					document.getElementById('maxzoom').value='+';
					document.getElementById('minzoom').value='-';
				}
			}
			if (e>0)
			{
				if (document.getElementById('maxzoom').value=='+') {
					needzoom=1;
					document.getElementById('minzoom').value='-';
					document.getElementById('maxzoom').value='0';
				}else{
					document.getElementById('minzoom').value='-';
					document.getElementById('maxzoom').value='+';
				}
			}
			if (e==0)
			{
				document.getElementById('minzoom').value='-';
				document.getElementById('maxzoom').value='+';
			}
		}
		var _errors=[];
		function copyToClipboard(text) {
			if (window.clipboardData && window.clipboardData.setData) {
				// Internet Explorer-specific code path to prevent textarea being shown while dialog is visible.
				return window.clipboardData.setData("Text", text);

			}
			else if (document.queryCommandSupported && document.queryCommandSupported("copy")) {
				var textarea = document.createElement("textarea");
				textarea.textContent = text;
				textarea.style.position = "fixed";  // Prevent scrolling to bottom of page in Microsoft Edge.
				document.body.appendChild(textarea);
				textarea.select();
				try {
					return document.execCommand("copy");  // Security exception may be thrown by some browsers.
				}
				catch (ex) {
					console.warn("Copy to clipboard failed.", ex);
					return prompt("Copy to clipboard: Ctrl+C, Enter", text);
				}
				finally {
					document.body.removeChild(textarea);
				}
			}
		}
		function _onerror(e,e2)
		{
			if (_errors.length==0)
				setTimeout(function (){alert(JSON.stringify(_errors));copyToClipboard(JSON.stringify(_errors));},1500);
			_errors.push([e,e2]);
		}
